            <a class="navbar-brand text-light" href="#" >{'PET-STORE'}</a>
            <button class="btn btn-outline-info ms-1 me-4" id="searchBtn">{'Sign up'}</button>

                <ul class="navbar-nav me-auto d-flex flex-row">

                <li class="nav-item me-4">
